import React, { Component } from "react";
import Product from "./Product";

class Clock extends React.Component {
  state = {
    items: ["Item 1", "item 2"],
  };

  Clicked = (el) => {
    console.log(el);
  };

  render() {
    return (
      <div>
        <h1>Items below:</h1>
        {this.state.items.map((item, index) => {
          <h1 key={index} onClick={() => this.Clicked(index)}>
            {item}
          </h1>;
        })}
      </div>
    );
  }
}

export default Clock;
